import React, { Component } from 'react';
import "./landingPage.css"
import { useHistory } from 'react-router-dom';

const history = useHistory();

const handleEnterClick = () => {
  history.push('/home');
};
export class LandingPage extends Component {


  render(){ return (
    <div>
      <h1>Bienvenido a Henry Dogs</h1>
      <img src="https://c4.wallpaperflare.com/wallpaper/26/58/362/animales-corre-hierba-perro-wallpaper-preview.jpg" alt="Landing Page Image" />
      <button onClick={handleEnterClick}>Ingresar</button>
    </div>
  );
}
}

export default LandingPage;
